import classes from './Modal.module.css';
import Card from '../UserInterface/Card';
import { Link } from 'react-router-dom';

function Modal(props){
    const click = props.clickButtons;
    return (
        <Card>
        <div className={classes.modal}>
            <p>
                Login Here
            </p>
            <form>
                <p className={classes.criteria1}>Enter your IITG mail-id</p>
                <input className={classes.input1} type="text" placeholder="include @iitg.ac.in"></input>
                <p className={classes.criteria2}>Enter Password</p>
                <input className={classes.input2} type="password"></input>
            </form>
            <button type='submit' className={`${classes.btn} ${classes.maketrans} ${classes.hoverNoclass}`} onClick={click}>Login</button>
            <Link to='/'>
                <button className={`${classes.btn} ${classes.alt} ${classes.hoverYesclass}`}>Forgot Password</button>
            </Link>
        </div>
        </Card>
    );
}
 
export default Modal;
